Reports an 'async' function call without an expected 'await' prefix inside an 'async' function. Such call returns a 'Promise' and control flow is continued immediately. Example: 'async function bar() { /* ... */ }
async function foo() {
    bar(); // bad
}' After the quick-fix is applied, the 'await' prefix is added: 'async function bar() { /* ... */ }
async function foo() {
    await bar(); // good
}' When the 'Report for promises in return statements' checkbox is selected, also suggests adding 'await' in return statements. While this is generally not necessary, it gives two main benefits. You won't forget to add 'await' when surrounding your code with 'try-catch'. An explicit 'await' helps V8 runtime to provide async stack traces.

fullDescription.markdown:
Reports an `async` function call without an expected `await` prefix inside an `async` function. Such call returns a `Promise` and control flow is continued immediately.

Example:


    async function bar() { /* ... */ }
    async function foo() {
        bar(); // bad
    }


After the quick-fix is applied, the `await` prefix is added:


    async function bar() { /* ... */ }
    async function foo() {
        await bar(); // good
    }

When the 'Report for promises in return statements' checkbox is selected, also suggests adding `await` in return statements.  
While this is generally not necessary, it gives two main benefits.  

* You won't forget to add `await` when surrounding your code with `try-catch`.
* An explicit `await` helps V8 runtime to provide [async stack traces](https://bit.ly/v8-zero-cost-async-stack-traces).

