fullDescription.text:
Reports 'defer' and 'go' statements that call 'panic()' or 'recover()' directly. Such statements are rarely useful and might indicate a misuse of the 'panic()' and 'recover()' mechanism. In particular: 'go panic()': a newly-started goroutine will panic immediately. 'defer panic()': a function with this statement will always panic on exit. 'go recover()': has no effect as newly-started goroutine cannot panic. 'defer recover()': function with this statement will silently stop panicking. This could be a valid usage, but an idiomatic way is to inspect the value returned by 'recover()': 'defer func() {
  if r := recover(); r != nil {
    fmt.Println("Recovered from: ", r)
  }
}()' For more information about go statements and panics handling, refer to Handling panics and Go statements in the Go Language Specification.

Reports possibly incorrect conversions of 'uintptr' to 'unsafe.Pointer'. A conversion from 'uintptr' to 'unsafe.Pointer' is invalid if it implies that there is a 'uintptr'-typed word in memory that holds a pointer value, because that word will be invisible to stack copying and to the garbage collector. Example of invalid usage: 'nums := []int8{42, 24}
ptr := unsafe.Pointer(&nums[0])
addr := uintptr(ptr) // address is stored to a local variable
ptr = unsafe.Pointer(addr + uintptr(1))' Example of valid usage: 'nums := []int8{42, 24}
ptr := unsafe.Pointer(&nums[0])
ptr = unsafe.Pointer(uintptr(ptr) + uintptr(1))'

Reports calls to functions and methods that do not handle the call result of the 'error' type. An API of such functions imply that their execution might finish unsuccessfully and they would return an error. Calls that do not handle the error result could be an indication of the API misuse. Example: 'os.Remove("non-existing") // error is ignored' After the Handle error quick-fix is applied: 'err := os.Remove("non-existing") // error is handled
if err != nil {
  return err
}'

Reports code that can never be executed because there exists no control flow path to the code from the rest of the program. Example: 'func _() int {
 print(1)
 return 2
 println() // This code is unreachable 
 return 0
}'

Reports execution paths that do not call the 'cancel' function returned by 'context.WithCancel' and similar functions. The 'WithCancel', 'WithDeadline', and 'WithTimeout' functions take a 'Context' (the parent) and return a derived 'Context' (the child) and a 'CancelFunc'. Calling the 'CancelFunc' cancels the child and its children, removes the parent's reference to the child, and stops any associated timers. Failing to call the CancelFunc leaks the child and its children until the parent is canceled or the timer fires. For more information about the 'context' package, refer to Package context at go.dev. Example: 'func _(ctx context.Context, cancel func()) {
 var ctx2 context.Context
 ctx2, cancel = context.WithCancel(ctx)
 _ = ctx2
}'

Reports empty declarations. Empty declarations have no effect. If you remove them, you might improve code readability. Example: 'func main() {
 const () // empty declaration
}' You can apply the Delete empty declaration quick-fix to remove this declaration.

Reports methods with certain names in the following cases: the method's name matches the name of several well-known interface methods from the standard library the signature does not match the signature of the corresponding interface method Such methods might indicate that the receiver type is intended to satisfy an interface from the standard library, but fails to do so because of the mistake in the method's signature. Example: 'type MyReader []byte

func (r MyReader) ReadByte(data []byte) (byte, error) {
}' The usage is suspicious because it looks like an attempt to implement 'io.ByteReader' but the signature is wrong. More correct version will be as follows: 'type MyReader []byte

func (r MyReader) ReadByte() (byte, error) {
}'

Reports exported names that start with a package name. This inspection does not report such names in the 'main' package. Example: 'package myPackage

func MyPackageGetIP() {

}' The 'MyPackageGetIP' name will be highlighted as it starts with the package name. According to Package Names at github.com/golang, all references to names in a package will be done using the package name, so one can omit that name from the identifiers. For example, if you are in a package 'foo', you do not need a type 'FooFile', which clients will write as 'foo.FooFile'. Instead, we name the type 'File', which clients will write as 'foo.File'.

Reports type assertion or type switch on errors, for example, 'err.(*MyErr)' or 'switch err.(type)', and suggests using 'errors.As' instead. Since Go 1.13, errors can be wrapped using the 'fmt.Errorf' function with the '%w' verb. Therefore, type assertion or type switch on errors fails on wrapped errors. The preferred way for checking for a specific error type is to use the errors.As function from the standard library as this function traverses the chain of the wrapped errors while checking for a specific error type. For more information about 'errors.As', refer to working with Errors in Go 1.13. The quick-fix replaces type assertion and type switch on errors with a call to 'errors.As'. Example 'errFoo, ok := err.(*ErrFoo)


switch err.(type) {
  case *ErrBar:
}' After the quick fix is applied: 'var errFoo *ErrFoo
ok := errors.As(err, &errFoo)

var errBar *ErrBar
switch {
case errors.As(err, &errBar):
}'

Reports structures with methods that use a mixture of types: value and pointer receivers. Such usage is not recommended by the Go Documentation. For more information, refer to Should I define methods on values or pointers? in the Go FAQ. Example: 'type S struct{
}

func (s *S) fun() {}
func (s S) fun2() {}'

