Reports assignment statements of the form 'x = atomic.AddUint64(&x, 1)'. Such operations are not atomic, and is a common misuse of the 'sync/atomic' API. To make them atomic, one need to remove the assignment to use a direct call: 'atomic.AddUint64(&x, 1)'. In that case, the value of 'x' will be updated atomically by address. Example: 'import (
 "sync/atomic"
)

type Counter uint64

func AtomicTests() {
 x := uint64(1)
 x = atomic.AddUint64(&x, 1)         // ERROR "direct assignment to atomic value"
 _, x = 10, atomic.AddUint64(&x, 1)  // ERROR "direct assignment to atomic value"
 x, _ = atomic.AddUint64(&x, 1), 10  // ERROR "direct assignment to atomic value"
}'

Reports struct tags that do not conform to Go conventions for struct tags. According to these conventions, tag strings are a concatenation of optionally space-separated 'key:"value"' pairs. Each key is a non-empty string consisting of non-control characters other than 'space (U+0020 ' ')', 'quote (U+0022 '"')', and 'colon (U+003A ':')'. Each value is quoted using 'U+0022 '"'' characters and Go string literal syntax. Also, the inspection checks that fields with tags are exported. Example of a valid tag: 'type Example struct {
  Field int `json:"field" xml:"demo"`
}'

Reports redundant parentheses in expressions and types. Example: 'func _(x (int), y ((string))) {
}
func _() {
 _ = (1 + 1)
 _ = (((1 + 1)))
 _ = (((1 + 1))) + (((2 + 2)))
}' After the Unwrap parentheses quick-fix is applied: 'func _(x int, y string) {
}
func _() {
